func newRouterStep() *sqlgraph.Step {
	return sqlgraph.NewStep(
		sqlgraph.From(Table, FieldID),
		sqlgraph.To(RouterInverseTable, FieldID),
		sqlgraph.Edge(sqlgraph.M2O, true, RouterTable, RouterColumn),
	)
}
